  import React from 'react'
import { Button, Card } from 'react-bootstrap'
// // import StarRatingComponent from 'react-star-rating-component';
  import '../App.css'
import { Link } from 'react-router-dom'


 function ActivityCard({el}) {
   return (
     <div>
         <Card style={{ width:'300px', heigth:'400px'}} className='card'>
   <Card.Img style={{ heigth:'400px'}} className='img'  src={el.posterUrl} />
   <Card.Body>
     <Card.activityName><h2>{el.activityName}</h2></Card.activityName>
      <Card.Text>
      Interstellar, ou Interstellaire  Michael Caine, Casey Affleck et Matt Damon.
    </Card.Text>
    <Button variant="primary" as={Link} to={`/Activity/${el.id}`}>See more</Button>
     <Card.Text>
//      {/* <StarRatingComponent 
//            name="Activity" 
//           value = {el.rate}
//     /> */}
     </Card.Text>
      <Button style={{background:'black', color:"grey"}} variant="primary" >activityTime</Button>
   </Card.Body>
 </Card>
     </div>
   )
 }

 export default ActivityCard
